return ['domain'=>NULL,'plural-forms'=>'nplurals=1; plural=0;','language'=>'zh','pot-creation-date'=>'2025-06-09 11:23-0700','po-revision-date'=>'2025-06-09 11:26-0700','translation-revision-date'=>'2025-06-09 11:26-0700','project-id-version'=>'Print My Blog','x-generator'=>'Poedit 3.6','messages'=>['Purpose'=>'目的','Similar to Print My Blog Quick Print and dotEpub, but supporting Pro features. Great for printing your WordPress content as an eBook for reading from a tablet or phone, or uploading to eBook marketplaces like Amazon or Apple Book Store.'=>'类似于Print My Blog Quick Print和dotEpub，但支持Pro功能。非常适合将您的WordPress内容打印为电子书，以便从平板电脑或手机阅读，或上传到亚马逊或Apple Book Store等电子书市场。','A table of contents is generated and inserted into the book (no need to add it using an external service like Kindle Direct Publishing or Calibre).'=>'目录将生成并插入到书中（无需使用Kindle Direct Publishing或Calibre等外部服务添加目录）。','Images are bundled into the book file so they can be used offline.'=>'图像捆绑到书籍文件中，以便可以离线使用。','Image galleries are rearranged into a simple list of images which displays better on smaller devices.'=>'图像库被重新排列成一个简单的图像列表，在较小的设备上显示得更好。','If there are any features or options you want, %1$splease get in touch.%2$s'=>'如果您需要任何功能或选项，%1$s请与我们联系。%2$s','Features'=>'特征','Supports nesting articles (like posts and pages) into “parts”'=>'支持将文章（如帖子和页面）嵌套为“部分”','External hyperlinks (links to web pages not in the project) are left as working hyperlinks'=>'外部超链接（指向不在项目中的网页的链接）保留为工作超链接','Internal hyperlinks (links to content included in the project) are converted into links to the appropriate page of the eBook'=>'内部超链接（指向项目中包含的内容的链接）将转换为指向电子书相应页面的链接','The default title page can include: Project Title, Subtitle, Site URL, Date Printed, Credit to Print My Blog'=>'默认标题页可以包括：项目标题、副标题、网站 URL、打印日期、打印我的博客的信用','Each article can include: Title, ID, Author, URL, Date Published, Categories and Tags, Featured Image, Excerpt, Custom Fields, Content'=>'每篇文章可以包括：标题、ID、作者、URL、发布日期、类别和标签、特色图片、摘录、自定义字段、内容','All images are automatically included in the ePub file (instead of merely pointing to the external image source). This makes the filesize larger, but allows users to view images while disconnected from the Internet.'=>'所有图像都会自动包含在 ePub 文件中（而不仅仅是指向外部图像源）。这使得文件大小更大，但允许用户在与互联网断开连接时查看图像。','Small images are automatically centered'=>'小图像自动居中','Image galleries are converted into regular list of images, which look better on small screens.'=>'图像库将转换为常规图像列表，在小屏幕上看起来更好。','Page Layout'=>'页面布局','The page design is mostly dictated by the app and device used for reading'=>'页面设计主要由用于阅读的应用程序和设备决定','Each article begins on a new page.'=>'每篇文章都从新页面开始。','ID:%s'=>'编号：%s','By %s'=>'由 %s','Powered by WordPress & Print My Blog'=>'由WordPress提供支持&打印我的博客','comments title' . "\4" . 'One Reply to &ldquo;%s&rdquo;'=>'一个回答 &ldquo;%s&rdquo;','comments title' . "\4" . '%1$s Reply to &ldquo;%2$s&rdquo;'=>'%1$s 个回复 &ldquo;%2$s&rdquo;','Printed on %1$s'=>'印在%1$s上','Designed for a school, company, or organization that wants to include their name, logo, and colors throughout the PDF. Because of its exstensive use of colors, it’s usually best viewed from a computer or handheld device.'=>'专为希望在整个 PDF 中包含其名称、徽标和颜色的学校、公司或组织而设计。由于其广泛使用的颜色，通常最好从计算机或手持设备查看。','Easier content editing because there are no nesting parts.'=>'更容易编辑内容，因为没有嵌套部分。','All hyperlinks converted into footnotes'=>'所有超链接转换为脚注','The title page can include your organization’s name, project title, issue number, list of authors, and an introductory paragraph.'=>'标题页可以包含组织的名称、项目标题、期号、作者列表和介绍性段落。','Each article includes just its title and content'=>'每篇文章仅包含其标题和内容','The default title page includes a stylized banner (with customizable color) above a colored background featuring a large version of your company logo.'=>'默认标题页在彩色背景上方包含一个风格化的横幅（具有可自定义的颜色），其中包含大版本的公司徽标。','Main matter pages fade from white to a color of your choosing in the corner where your logo and page number are shown.'=>'主要内容页面在显示徽标和页码的角落从白色淡出为您选择的颜色。','Page numbers in bottom-right corner, and article titles in the top-right. Front-matter’s pages are numbered with Roman numerals'=>'页码在右下角，文章标题在右上角。封面的页面用罗马数字编号','Each article begins on a new page'=>'每篇文章都从新页面开始','Back matter uses your large company logo with background color'=>'背面使用带有背景色的大公司徽标','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for making a PDF for an easy-to-read digital backup of your favorite website content.'=>'与“打印我的博客快速打印”非常相似，但支持 Pro 功能。非常适合制作 PDF，以便对您喜欢的网站内容进行易于阅读的数字备份。','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes, left in-place, or removed'=>'外部超链接（指向不在项目中的网页的链接）可以自动转换为脚注、保留在原位或删除','Footnotes only work with Pro'=>'脚注仅适用于专业版','Internal hyperlinks (links to content included in the project) can be automatically converted to to footnotes, inline page references, left in-place, or removed'=>'内部超链接（指向项目中包含的内容的链接）可以自动转换为脚注、内联页面引用、保留或删除','Footnotes and page references only work with Pro PDF Service'=>'脚注和页面引用仅适用于专业 PDF 服务','Limit image size by setting maximum height'=>'通过设置最大高度来限制图像大小','Optionally automatically center images'=>'可选自动将图像居中','Optionally float images to the top or bottom of each page'=>'（可选）将图像浮动到每个页面的顶部或底部','Page numbers in bottom-right corner, article titles in the top-right, and part titles (if using parts) appear in the top-left corner. Front-matter’s pages are numbered with Roman numerals'=>'页码显示在右下角，文章标题在右上角，部分标题（如果使用部件）显示在左上角。封面的页面用罗马数字编号','Most browsers add their own content to the page margins'=>'大多数浏览器将自己的内容添加到页边距','Each article can optionally begin on a new page'=>'每篇文章都可以选择从新页面开始','Designed to look good when viewed from a device or printing to paper. The two-column layout leads to more compact content, especially good if your content doesn’t require the full page width'=>'设计为从设备查看或打印到纸张时看起来不错。两列布局可带来更紧凑的内容，如果您的内容不需要整个页面宽度，则尤其好','Most browsers will only print a white background'=>'大多数浏览器只会打印白色背景','Main matter is divided into two columns, while front matter uses the full page width.'=>'主要内容分为两列，而前部分使用整个页面宽度。','Some browsers don‘t support multiple columns'=>'某些浏览器不支持多列','Content can be divided into parts with a special part opening area using the full page width.'=>'内容可以使用全页宽度划分为具有特殊部分打开区域的各个部分。','The title page can include a title and preamble. Other content can immediately follow, without needing a page break.'=>'标题页可以包含标题和序言。其他内容可以立即跟进，而无需分页符。','Each article includes just its title and content, and an optional dividing line to help distinguish between articles.'=>'每篇文章仅包含其标题和内容，以及可选的分界线以帮助区分文章。','If your content is already divided into columns, optionally automatically remove them to improve the layout.'=>'如果您的内容已划分为多个列，可以选择自动删除它们以改进布局。','Optionally begin each post on a new page, or be shown immediately following the previous one.'=>'（可选）在新页面上开始每篇文章，或紧跟在上一个页面之后显示。','Optionally have each article title take up the full page width, or show them inside columns.'=>'（可选）让每个文章标题占据整个页面宽度，或在列内显示它们。','Internal links (hyperlinks to content included in the project) are replaced with page references.'=>'内部链接（指向项目中包含的内容的超链接）将替换为页面引用。','External links (hyperlinks to content on the internet) are left as-is.'=>'外部链接（指向互联网上内容的超链接）保持原样。','Most content is divided between two columns.'=>'大多数内容分为两列。','Page numbers in bottom-right corner, and part titles in the top-left. Front-matter’s pages are numbered with Roman numerals'=>'页码在右下角，部分标题在左上角。封面的页面用罗马数字编号','Special Instructions'=>'给店家留言','Front matter defaults to using the full page width. To force something to be divided into columns, add the CSS class "mayer-columns" inside your content.'=>'前言默认使用整页宽度。要强制将某些内容划分为列，请在内容中添加 CSS 类“mayer-columns”。','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for printing your WordPress content.'=>'与“打印我的博客快速打印”非常相似，但支持 Pro 功能。非常适合打印您的WordPress内容。','For creating a printout of your WordPress content that saves paper and ink.'=>'用于创建节省纸张和墨水的WordPress内容的打印输出。','This design uses a smaller font, small images, doesn’t add pagebreaks between articles, and avoids unnecessary extra information.'=>'此设计使用较小的字体，小图像，不会在文章之间添加分页符，并避免不必要的额外信息。','Perfect for editing and reviewing your content! Compact to conserve paper, lots of meta-information, and double-spaced text to allow for editor’s notes.'=>'非常适合编辑和审查您的内容！紧凑以节省纸张，大量元信息和双倍行距文本，以允许编辑注释。','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes or removed'=>'外部超链接（指向不在项目中的网页的链接）可以自动转换为脚注或删除','Footnotes require Pro'=>'脚注需要专业版','Internal hyperlinks (links to content included in the project) can be automatically converted to footnotes, inline page references, or removed'=>'内部超链接（指向项目中包含的内容的链接）可以自动转换为脚注、内联页面引用或删除','Footnotes and page references require Pro PDF Service'=>'脚注和页面引用需要专业 PDF 服务','This design is meant for printing on both sides of the page so you see two pages at once (the "page spread"). So the left-hand page will be styled differently than the right-hand page.'=>'此设计用于在页面的两面打印，以便您一次看到两页（“页面跨页”）。因此，左侧页面的样式将与右侧页面不同。','Page numbers in bottom-outside corner, part titles appear in the top of the left page, article titles appear at the top of the right page. Front-matter’s pages are numbered with Roman numerals'=>'页码在下外角，部分标题显示在左页的顶部，文章标题显示在右页的顶部。封面的页面用罗马数字编号','Multi-column newspaper design designed for printing. Wide images can span multiple columns and always snap to the nearest page edge to make a visually-appealing layout.'=>'专为印刷而设计的多列报纸设计。宽图像可以跨越多列，并始终与最近的页面边缘对齐，以形成视觉上吸引人的布局。','The "Title page" is actually a special header on the front page containing your publication\'s title, issue number, date, and other optional prominent info (set on the design and project meta settings).'=>'“标题页”实际上是首页上的一个特殊标题，其中包含出版物的标题、期号、日期和其他可选的突出信息（在设计和项目元设置上设置）。','Content is divided into two, three, or four columns.'=>'内容分为两列、三列或四列。','The top margin contains the front page (publication title, issue number, date, etc.).'=>'上页边距包含首页（出版物标题、期号、日期等）。','Designed for duplex printing with the left page mirroring the right page\'s margins.'=>'专为双面打印而设计，左页镜像右页边距。','Content can be divided into parts. Part openings and important articles\' titles and cover images take up the full page width, whereas regular articles compactly fit into columns.'=>'内容可以分为几个部分。部分开口和重要文章的标题和封面图像占据了整个页面的宽度，而常规文章紧凑地适合列。','Each article may include post title, ID, author, published date, categories and tags, URL, featured image, excerpt, custom fields, and content.'=>'每篇文章可能包括帖子标题、ID、作者、发布日期、类别和标签、URL、特色图片、摘录、自定义字段和内容。','Issue and page number are in the outside top margin, the publication\'s title is in the middle top margin, and the publication date is in the inside top margin. The optional publication subtitle is underneath the other top-margin content.'=>'期号和页码位于外上边距，出版物的标题位于中间上边距，出版日期位于内上边距。可选的出版物副标题位于其他上边距内容的下方。','Section Templates'=>'章节模板','Choose different styles for articles included in your project:'=>'为项目中包含的文章选择不同的样式：','Default Template: shows all content specified by the "Post Content" design setting (e.g. the article\'s title and featured image) in columns.'=>'默认模板：在列中显示“帖子内容”设计设置指定的所有内容（例如文章标题和特色图片）。','Single Column: like the default template, but in a single column.'=>'单列：在单列中显示“发布内容”设计设置指定的所有内容。','Fullpage Content: contains only the article\'s content (no title, featured image, etc.) all in a single, wide column.'=>'整页内容：仅包含文章的内容（无标题、特色图片等）全部包含在一个宽的列中。','Full Column Content: like "Fullpage Content", except content is still divided into multiple columns..'=>'全栏内容：与“整页内容”类似，除了内容仍分为多个列。','Important: shows the article\'s featured image and title across all columns, but other content is shown in multiple columns.'=>'重要提示：在所有列中显示文章的精选图片和标题，但其他内容会显示在多个列中。','Parts start on a new page and include the part’s title, featured image, and content.'=>'部件从新页面开始，包括部件的标题、特色图像和内容。','Note that in order to improve page layout, all images and figures snap to the nearest page edge.'=>'请注意，为了改进页面布局，所有图像和图形都与最近的页面边缘对齐。','"Full width" images take up all columns and snap to the nearest page edge.'=>'“全宽”图像占据所有列并捕捉到最近的页面边缘。','"Wide width" images take up 2 columns and snap to the nearest page edge.'=>'“宽宽”图像占据 2 列并捕捉到最近的页面边缘。','Only works with PMB’s Pro PDF Service.'=>'仅适用于PMB的专业PDF服务。','%1$sAdd the CSS class "%2$s"%3$s to any images you don\'t want to snap like this.'=>'%1$s将CSS类“%2$s”%3$s添加到您不想像这样拍摄的任何图像中。','Issue %s, Page %s'=>'第 %s 期，第 %s 页','Issue %s'=>'问题%s','Similar to Print My Blog Quick Print\'s other "Classic" designs, except optimized for reading by Microsoft Word. Useful when you need to deliver your content as a Microsoft Word Document (like to an editor), or for using as an intermediate format for delivery to other applications (like for importing into Adobe InDesign).'=>'与Print My Blog Quick Print的其他“经典”设计类似，除了针对Microsoft Word的阅读进行了优化。当您需要将内容作为 Microsoft Word 文档（如编辑器）交付，或用作交付到其他应用程序的中间格式（如导入到 Adobe InDesign 中）时非常有用。','A table of contents is generated and inserted at the requested location. Once in Microsoft Word, right click on the table of contents and click "Update Field"; or press Ctrl + A, then F9.'=>'将生成目录并将其插入到请求的位置。进入微软Word后，右键单击目录，然后单击“更新字段”;或按 Ctrl + A，然后按 F9。','Images may be bundled into the Word Document file so they can be used offline or if the website hosting the images goes offline.'=>'图像可以捆绑到 Word 文档文件中，以便它们可以脱机使用，或者如果托管图像的网站脱机。','External hyperlinks (links to web pages not in the project) may be left as working hyperlinks or removed'=>'外部超链接（指向不在项目中的网页的链接）可能会保留为工作超链接或删除','Internal hyperlinks (links to content included in the project) may be converted into links to the appropriate page of the document, left as hyperlinks to the website, or removed.'=>'内部超链接（指向项目中包含的内容的链接）可以转换为指向文档相应页面的链接，保留为指向网站的超链接或删除。','All images are automatically included in the Word Document file (instead of merely pointing to the external image source). This makes the filesize larger, but allows users to view images while disconnected from the Internet.'=>'所有图像都自动包含在 Word 文档文件中（而不仅仅是指向外部图像源）。这使得文件大小更大，但允许用户在与互联网断开连接时查看图像。','Powered by Print My Blog Pro & WordPress'=>'由Print My Blog Pro和WordPress提供支持','Purchase Required'=>'需要购买','Works better with %1$sPro PDF Service%2$s'=>'与%1$sPro PDF服务配合使用效果更好%2$s','More Advanced Features in %1$sPro Print%2$s'=>'%1$sPro 打印中的更多高级功能%2$s','Drag the %s "%s" into your project'=>'将%s“%s”拖到项目中','View "%s"'=>'查看 %s','Edit "%s"'=>'编辑"%s"','Replace "%s" with the existing Print Material for customizing.'=>'将“%s”替换为现有的打印材料以进行定制。','Replace "%s" with a New Print Material for customizing'=>'将“%s”替换为用于定制的新打印材料','Upgrade to Professional License for one-click copying to Print Materials for customization.'=>'升级到专业许可证，一键复制到打印材料进行定制。','Add "%s" to project'=>'将“%s”添加到项目','Remove "%s"'=>'添加或删除 %s','Drag or click here'=>'拖动或单击此处','Post custom field name' . "\4" . '%s:'=>'%s:','We’re sorry, but you have another version of Print My Blog active. Only one can be active at a time. Please deactivate one.'=>'很抱歉，您有另一个版本的“打印我的博客”处于活动状态。一次只能有一个处于活动状态。请停用一个。','We’re sorry, but Print My Blog requires PHP version %1$s or greater in order to operate. You are currently running version %2$s.%3$sIn order to update your version of PHP, you will need to contact your current hosting provider.%3$sFor information on stable PHP versions, please go to %4$s.'=>'很抱歉，“打印我的博客”需要 PHP 版本 %1$s 或更高版本才能运行。您当前正在运行版本 %2$s。%3$s为了更新您的PHP版本，您需要联系您当前的托管服务提供商。%3$s有关稳定 PHP 版本的信息，请访问%4$s。','We’re sorry, but Print My Blog requires WordPress %1$s. You are using %2$s.%3$sFor information on how to update, please see %4$s.'=>'很抱歉，“打印我的博客”需要 WordPress %1$s。您正在使用%2$s。%3$s有关如何更新的信息，请参阅%4$s。','360 Image Available'=>'360 度图片可用','Language'=>'语言','All Languages'=>'所有语言','Default language (currently %s)'=>'默认语言（当前%s）','Translate %s Design'=>'翻译%s设计','%s Translations'=>'%s翻译','Translate Project Metadata'=>'翻译项目元数据','"%1$s" is fully translated into %2$s'=>'“%1$s”完全翻译成%2$s','Print My Blog'=>'打印我的博客','Pro Print'=>'专业打印','Print My Blog – Quick Print'=>'打印我的博客 - 快速打印','Quick Print'=>'快速打印','Print My Blog Designs'=>'打印我的博客设置','Designs'=>'设计','Print My Blog Settings'=>'打印我的博客设置','Settings'=>'设置','Help Me Print My Blog'=>'帮我打印我的博客','Help'=>'帮助','Keyboard Accessibility'=>'键盘辅助功能','Settings Saved!'=>'设置已保存！','You should see the changes on your %1$slatest post%2$s.'=>'您应该会在%1$s最新帖子%2$s上看到更改。','Show print buttons on:'=>'在以下位置显示打印按钮：','Note: you need to upgrade your license to access the following formats: %s'=>'注意：您需要升级许可证才能访问以下格式：%s','Print Formats'=>'打印格式','Email Print My Blog Support'=>'电子邮件打印我的博客支持','Email successfully sent. Expect a reply in the next 1-2 business days.'=>'电子邮件已成功发送。预计在接下来的 1-2 个工作日内收到回复。','There was an error sending an email from your website (it was "%1$s"). Please manually send an email to %2$s, with the subject "%3$s", with the content:'=>'从您的网站发送电子邮件时出错（为“%1$s”）。请手动向%2$s发送电子邮件，主题为“%3$s”，内容如下：','Please explain what you did, what you expected, and what went wrong'=>'请解释你做了什么，你期望什么，以及出了什么问题','Including links to screenshots is appreciated'=>'包括屏幕截图的链接是值得赞赏的','Your Name'=>'你的名字','Are you ok with us viewing your most recent generated documents?'=>'您是否同意我们查看您最近生成的文档？','Viewing your most recent generated documents saves a lot of time figuring out what is going wrong. We won’t share your content with anyone else.'=>'查看最近生成的文档可以节省大量时间来确定出了什么问题。我们不会与其他任何人分享您的内容。','This debug info will also be sent.'=>'还将发送此调试信息。','This is mostly system information, list of active plugins, active theme, and some Print My Blog Pro info like your most recent projects.'=>'这主要是系统信息，活动插件列表，活动主题和一些“打印我的博客专业版”信息，例如您最近的项目。','Support for your plan is offered on GitHub'=>'GitHub 上提供对您的计划的支持','GitHub is a public forum to share your issues with the developer and other users.'=>'GitHub 是一个公共论坛，用于与开发人员和其他用户分享您的问题。','You will need to first %1$screate a GitHub account%2$s. If you prefer to use email support please %3$spurchase a license that offers email support.%2$s'=>'您需要首先%1$s创建一个 GitHub 帐户%2$s。如果您更喜欢使用电子邮件支持，请%3$s购买提供电子邮件支持的许可证。%2$s','Delete All Data'=>'删除所有数据','Please select items to add to the project'=>'请选择要添加到项目中的项目','Please select items to remove'=>'请选择要删除的项目','Please select items to move'=>'请选择要移动的项目',