l the text manually and copy it.'=>'复制时出错。您仍然可以手动选择所有文本并复制它。','Title'=>'标题','Date'=>'日期','Delete'=>'删除','Untitled'=>'无标题','Duplicate'=>'复制','Feature included in Professional and Business licenses'=>'专业和商业许可证中包含的功能','Started'=>'已开始','%1$s at %2$s'=>'%1$s 于 %2$s','Y/m/d'=>'Y/m/d','g:i a'=>'g:i a','Click "Add New Project" 👆 To Make Your First Project!'=>'点击“添加新项目”👆，制作您的第一个项目！','Classic Print PDf'=>'经典打印 PDf','Font Settings'=>'字体设置','Paragraph Indent'=>'段落缩进','Indent the first line of each new paragraph instead of adding a paragraph break.'=>'缩进每个新段落的第一行，而不是添加段落分隔符。','Link, Page Reference, and Footnote Settings'=>'链接、页面引用和脚注设置','Remove'=>'删除','Replace with page reference'=>'替换为页面引用','Replace with footnote'=>'替换为脚注','Internal Hyperlinks'=>'内部超链接','How to display hyperlinks to content included in this project.'=>'如何显示指向此项目中包含的内容的超链接。','External Hyperlinks'=>'外部超链接','How to display hyperlinks to content not included in this project.'=>'如何显示指向此项目中未包含的内容的超链接。','Classic Digital PDF'=>'经典数字 PDF','Buurma Digital PDF'=>'布尔玛数字 PDF','Title Page Top-Banner Color'=>'标题页顶部横幅颜色','Image used at the top of the background on the title page.'=>'标题页背景顶部使用的图像。','Background Color'=>'背景颜色','A gradient between this color and white will be used in the page backgrounds'=>'此颜色和白色之间的渐变将在页面背景中使用','Organization Name'=>'组织名称','Shown in the title page. Eg "Institute of Print My Blog"'=>'显示在标题页中。例如“印刷我的博客研究所”','Background Embellishment'=>'背景装饰','Faded image used as a full-page background on the title page, and next to the page number on numbered pages.'=>'褪色的图像用作标题页上的整页背景，以及编号页上页码旁边的图像。','Issue'=>'问题','Text that appears at the top-right of the cover'=>'显示在封面右上角的文本','ByLine'=>'署名','Project Author(s)'=>'项目作者','Date Issued'=>'签发日期','Text that appears under the byline'=>'署名下显示的文本','Coverpage Preamble'=>'封面序言','Explanatory text that appears at the bottom of the cover page'=>'封面底部显示的说明性文本','Mayer Digital PDF'=>'孖士打数码 PDF','Each Post Begins on a New Page'=>'每个帖子都从新页面开始','Browser support for pagebreaks on columns is typically not very good.'=>'浏览器对列分页符的支持通常不是很好。','Whether to force posts to always start on a new page. Doing so makes the page more legible, but uses more paper.'=>'是否强制帖子始终从新页面开始。这样做会使页面更清晰，但会使用更多的纸张。','Show Post Header inside Columns'=>'在列内显示帖子标题','Check this to make post header information, like title, date, author, etc, appear inside columns; uncheck this to have it take up the full page width'=>'检查此选项以使帖子标题信息（如标题、日期、作者等）显示在列内;取消选中此选项以使其占据整个页面宽度','Show a Dividing Line Between Posts'=>'显示帖子之间的分界线','Full-Column Images'=>'全列图像','Resizes images to be the full column width (except ones with the CSS class "mayer-no-resize")'=>'将图像大小调整为全列宽度（CSS类为“mayer-no-resize”的图像除外）','Remove Extra Columns'=>'删除多余的列','Forces your content to only use two columns, even if the content itself was divided into more columns (eg using the "Columns" block)'=>'强制您的内容仅使用两列，即使内容本身被分成更多列（例如使用“列”块）','Byline'=>'署名','Project author(s)'=>'项目作者','Classic ePub'=>'经典电子酒吧','Convert Videos to Images and Links'=>'将视频转换为图像和链接','Some eReaders don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'某些电子阅读器不显示视频，在这种情况下，您可能更愿意将其替换为图像和指向在线视频内容的超链接。','Title page and Part Header Font Size'=>'标题页和部分页眉字体大小','Font size used for the default title page’s and part’s header (all other headers’ sizes are derived from the main font size). Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'用于默认标题页和部分页眉的字体大小（所有其他标题的大小均派生自主字体大小）。使用任何可识别的%1$sCSS字体大小关键字%2$s（如“大”，“中”，“小”）或%3$s任何单位的长度%2$s（例如“14pt”，“50%%”或“10px”）。','Custom Header Font'=>'自定义页眉字体','Default font to use for headers of articles, parts, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'用于文章、部件等标题的默认字体。扩展名为“ttf”的字体文件适用于大多数电子书阅读器。留空以使用默认字体。','Font Size'=>'字体大小','Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'使用任何可识别的%1$sCSS字体大小关键字%2$s（如“大”，“中”，“小”）或%3$s任何单位的长度%2$s（例如“14pt”，“50%%”或“10px”）。','Custom Font'=>'自定义字体','Default font used in paragraphs, lists, tables, captions, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'段落、列表、表格、标题等中使用的默认字体。扩展名为“ttf”的字体文件适用于大多数电子书阅读器。留空以使用默认字体。','File name'=>'文件名','Description'=>'描述','Shown as eBook metadata.'=>'显示为电子书元数据。','Cover Image'=>'封面图片','Cover image used on eBook file (does not necessarily appear inside project). Ideal dimensions are 2,560 x 1,600 pixels.'=>'电子书文件中使用的封面图像（不一定出现在项目中）。理想尺寸为 2，560 x 1，600 像素。','Classic Word'=>'经典词汇','Headers and Footers'=>'标题字体','Document Header on First Page'=>'第一页上的文档页眉','Content to appear in top margin area but only on the first page.'=>'内容显示在上边距区域，但仅在第一页上显示。','Document Header on Subsequent Pages'=>'后续页面上的文档页眉','Content to appear in top margin area on all pages except the first page.'=>'要在除第一页之外的所有页面上的上边距区域中显示的内容。','Document Footer'=>'文档页脚','Content to appear in bottom margin area.'=>'要打印的每个帖子中的内容。','Some Word Processors don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'某些文字处理器不显示视频，在这种情况下，您可能希望将它们替换为图像和指向在线视频内容的超链接。','Maximum Image Height (in pixels)'=>'最大图像高度（以像素为单位）','Larger images will be resized to this, smaller images will be unchanged.'=>'较大的图像将调整为此大小，较小的图像将保持不变。','Leave as hyperlink to website'=>'保留为指向网站的超链接','Leave as hyperlink to document'=>'保留为文档的超链接','Leave as hyperlink'=>'保留为超链接','Haller Tabloid Print PDF'=>'哈勒小报打印 PDF','Logo image to show on the front page and in the header of subsequent pages. Leave blank to just use a "Title of Publication".'=>'徽标图像显示在首页和后续页面的标题中。留空仅使用“出版物标题”。','Title of Publication'=>'出版物名称','Shown in a large font on front page and in the top margin of every subsequent page.'=>'在首页和后续每一页的上边距中以大字体显示。','Subtitle of Publication'=>'出版副标题','Shown under the name of the publication, in a slightly smaller font.'=>'显示在出版物名称下，字体略小。','Publication Preamble'=>'出版序言','Shown on the front page under the Title and Subtitle.'=>'显示在首页的标题和副标题下。','Columns'=>'列','Number of columns to use for content.'=>'用于内容的列数。','Shown on frontpage and in the top margin of all subsequent pages.'=>'显示在首页和所有后续页面的上边距中。','Issue Number'=>'发行好','Shown on the frontpage and in the top margin of all subsequent pages (shortcodes supported).'=>'显示在首页和所有后续页面的上边距（支持短代码）。','Frontpage Title Left Call-Out'=>'头版标题左标注','HTML displayed to the left of the title on the frontpage (shortcodes supported).'=>'HTML 显示在首页标题的左侧（支持短代码）。','Frontpage Title Right Call-Out'=>'头版标题右标注','HTML displayed to the right of the title on the frontpage'=>'HTML 显示在首页标题的右侧','Subtitle'=>'副标题','Source Location'=>'来源库位','Shown on the title page under the subtitle. Could be your website’s URL, or anything else you like.'=>'显示在标题页的副标题下。可能是您网站的 URL，也可以是您喜欢的任何其他内容。','Site URL'=>'网站网址','Date Printed'=>'打印日期','Title Page Content'=>'标题页内容','Post Title'=>'文章标题','ID'=>'ID','Author'=>'作者','Published Date'=>'发布日期','Categories and Tags'=>'分类和标签','URL'=>'URL','Featured Image'=>'特色图片','Excerpt'=>'摘要','Custom Fields'=>'自定义字段','Content'=>'内容','Post Content'=>'文章内容','Content from each post to print.'=>'要打印的每个帖子中的内容。','Image & Block Settings'=>'图像和块设置','Page Settings'=>'页面设置','Page Width'=>'页面宽度','Not supported by some browsers'=>'某些浏览器不支持','Use standard %1$sCSS units%2$s'=>'使用标准 %1$sCSS 单位%2$s','Page Height'=>'页面高度','Your theme, "%1$s", can be used in conjunction with your design. Themes are often not intended for print and can conflict with the design, but you may have content that looks broken without the theme.'=>'您的主题“%1$s”可以与您的设计结合使用。主题通常不用于打印，并且可能与设计冲突，但如果没有主题，您的内容可能会看起来很糟糕。','Note: this option is only supported for the business license.'=>'注意：此选项仅支持营业执照。','Don’t Change Image Quality'=>'不要更改图像质量','%s pixels wide'=>'%s 像素宽','Full Size (on web)'=>'全尺寸（网络）','Uploaded Size (largest possible)'=>'上传大小（可能的最大尺寸）','Image Quality (in pixels)'=>'图像质量（以像素为单位）','Lower quality means smaller file size, whereas higher quality means higher resolution images. Note: if images are missing from the generated PDF, the requested image size might not be available. Use the %1$s Regenerate Thumbnails plugin%2$s to create the missing image sizes.'=>'较低的质量意味着较小的文件大小，而较高的质量意味着更高分辨率的图像。注： 如果生成的 PDF 中缺少图像，则请求的图像大小可能不可用。使用%1$s重新生成缩略图插件%2$s创建缺少的图像大小。','Apply Website Theme'=>'应用网站主题','Custom CSS'=>'自定义CSS','Styles to be applied only when printing projects using this design.'=>'仅在使用此设计打印项目时应用的样式。','Add "Powered By"'=>'添加“动力来源”','In compliance with WordPress.org guidelines, not added when printing from your browser.'=>'符合 WordPress.org 准则，从浏览器打印时不添加。','Instructs the Pro PDF Service to add "Powered by Print My Blog Pro & WordPress" to your project. Does not appear when printing using your browser.'=>'指示 Pro PDF 服务将“Powered by Print My Blog Pro & WordPress”添加到您的项目中。使用浏览器打印时不显示。','Page Reference Text'=>'页面引用文本','Text to use when replacing a hyperlink with a page reference. "%s" will be replaced with the page number.'=>'将超链接替换为页面引用时要使用的文本。“%s”将替换为页码。','(see page %s)'=>'（见第%s页）','You must include "%s" in the page reference text so we know where to put the page number.'=>'您必须在页面参考文本中包含“%s”，以便我们知道将页码放在哪里。','Internal Footnote Text'=>'内部脚注文本','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the page number.'=>'将超链接替换为脚注时使用的文本。“%s”将替换为页码。','See page %s.'=>'请参阅第 %s 页。','You must include "%s" in the footnote text so we know where to put the URL.'=>'您必须在脚注文本中包含“%s”，以便我们知道将 URL 放在哪里。','External Footnote Text'=>'外部脚注文本','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the URL'=>'将超链接替换为脚注时使用的文本。“%s”将替换为网址','See %s.'=>'见%s.','None'=>'无','Center'=>'居中','Default Image Alignment'=>'默认图像对齐','Images normally default to "no alignment", which can look jumbled in printouts. Usually it’s best to automatically switch those to align to the center.'=>'图像通常默认为“无对齐”，在打印输出中看起来可能杂乱无章。通常，最好自动切换它们以对齐中心。','Don’t move'=>'别动','Snap to the top or bottom of the page'=>'对齐页面顶部或底部','Only snap if it would otherwise cause a page break'=>'仅当会导致分页符时才对齐','Resize images if they don’t fit on the page'=>'如果图像不适合页面，请调整图像大小','Image and Block Placement'=>'图像和块放置','Image snapping and dynamic resizing only works using the Pro PDF Service.'=>'图像捕捉和动态调整大小仅适用于专业打印。','To reduce whitespace around images, galleries, and tables, Print My Blog can adjust the placement of your content, or resize it according to the space on the page.'=>'若要减少图像、图库和表格周围的空白区域，“打印我的博客”可以调整内容的位置，或根据页面上的空间调整内容大小。','Minimum Image Size (in pixels)'=>'最小图像大小（以像素为单位）','Any images larger than this may be resized to fit onto the page, but they will be no smaller than this size.'=>'任何大于此大小的图像都可以调整大小以适应页面，但它们不会小于此大小。','Add QR Code to Videos'=>'为视频添加二维码','After a video is converted into a screenshot and URL, you can optionally add a QR code that readers can scan with their phones to view the video.'=>'将视频转换为屏幕截图和 URL 后，您可以选择添加 QR 码，读者可以用手机扫描该二维码以查看视频。','Arial'=>'Arial','Courier New'=>'Courier New','Georgia'=>'格鲁吉亚','Impact'=>'Impact 字体','Lucida Console'=>'露西达控制台','Palatino Linotype'=>'帕拉蒂诺·利诺类型','Tahoma'=>'Tahoma','Times New Roman'=>'Times New Roman','Verdana'=>'Verdana','Custom Font...'=>'自定义字体...','Header Font'=>'标题字体','Default font for header tags'=>'标题标签的默认字体','Specify the URL of a custom font file, or upload one. The formats "wff" and "wff2" work best, but "ttf" and "otf" also work.'=>'指定自定义字体文件的 URL，或上传一个。格式“wff”和“wff2”效果最好，但“ttf”和“otf”也有效。','Font'=>'字体','Default font used in paragraphs, bulleted lists, tables, etc.'=>'段落、项目符号列表、表格等中使用的默认字体。','A simple but flexible design intended mainly for reading from screens, inspired by Print My Blog Quick Print.'=>'一种简单但灵活的设计，主要用于从屏幕上阅读，灵感来自“打印我的博客快速打印”。','Title page, with working hyperlinks.'=>'标题页，带有有效的超链接。','Main matter, showing hyperlinks and large images.'=>'主要内容是显示超链接和大图像。','Editorial Review'=>'编辑评论','Your writing in an easy-to-review format for editors.'=>'您的写作以易于编辑审阅的格式进行。','Title page, showing the double-spaced text.'=>'标题页，显示双倍行距文本。','Main matter, showing smaller images and double-spaced text.'=>'主要内容，显示较小的图像和双倍行距的文本。','Classic Print PDF'=>'经典打印 PDF','A simple but flexible design intended for printing, inspired by Print My Blog Quick Print'=>'用于打印的简单但灵活的设计，灵感来自“打印我的博客”快速打印','Title page, showing removed hyperlinks.'=>'标题页，显示已删除的超链接。','Main matter, showing external hyperlinks automatically converted into footnotes. Page numbers are always on the bottom-outside corner, and each article’s title is shown at the top of right pages.'=>'主要内容，显示自动转换为脚注的外部超链接。页码始终位于外底角，每篇文章的标题显示在右页的顶部。','Economical Print PDF'=>'经济型打印 PDF','Compact design meant to save paper but still deliver all the content.'=>'紧凑的设计旨在节省纸张，但仍能提供所有内容。','Title page, showing smaller text.'=>'标题页，显示较小的文本。','Main matter, showing smaller text and images to reduce ink usage.'=>'主要内容是显示较小的文本和图像以减少墨水使用。','Buurma Whitepaper'=>'布尔玛白皮书','Stylized and branded PDF designed mainly for reading from a device, great for organizations'=>'风格化和品牌化的 PDF，主要用于从设备阅读，非常适合组织','Title page, showing a stylzed upper margin for a company name, background gradient and logo, among other things.'=>'标题页，显示公司名称、背景渐变和徽标等的样式化上边距。','Main matter, showing working hyperlinks (which also each get an automatic footnote), and page number and logo in bottom-right corner.'=>'主要内容，显示有效的超链接（每个超链接也有一个自动脚注），以及右下角的页码和徽标。','Issue 01'=>'第 01 期','Text explaining the purpose of the paper and gives a brief summary of it, so folks know they’re reading the right thing.'=>'解释论文目的的文本并给出它的简短摘要，以便人们知道他们正在阅读正确的内容。','Mayer Magazine'=>'梅耶杂志','Digital 2-column magazine inspired by the defunct Zinepal'=>'数字 2 栏杂志的灵感来自已停业的 Zinepal','Title page and table of contents both fit on the first page.'=>'标题页和目录都适合第一页。','Two column layout which compactly shows content and images.'=>'两列布局，紧凑地显示内容和图像。','Simple ePub for using when uploading as an eBook to Amazon and other epub marketplaces'=>'简单的 ePub，用于作为电子书上传到亚马逊和其他 epub 市场','Simple Microsoft Word document when that format is required.'=>'需要该格式时的简单Microsoft Word文档。','Title page and table of contents.'=>'标题页和目录。','Simple layout'=>'简单布局','Haller Tabloid'=>'哈勒小报','Print-ready newspaper design'=>'可打印的报纸设计','Digital PDF'=>'数字版 PDF','PDF file intended for viewing on a computer, tablet or phone, but not necessarily for printing to paper. Usually includes working hyperlinks, ample colors, and other features that require a device.'=>'用于在计算机、平板电脑或手机上查看的 PDF 文件，但不一定用于打印到纸张上。通常包括工作超链接、充足的颜色和其他需要设备的功能。','Print-Ready PDF'=>'可打印的 PDF','PDF file intended for printing on your home printer or with a printer service. Usually removes hyperlinks, avoids excessive ink use, and are designed for viewing the 2-page spread (using the front and back of a page).'=>'用于在家用打印机或使用打印机服务打印的 PDF 文件。通常删除超链接，避免过度使用墨水，并且设计用于查看 2 页跨页（使用页面的正面和背面）。','eBook (ePub)'=>'电子书（电子出版）','ePub file intended for reading from an eReader, tablet, or phone; or for publishing on an eBook marketplace like Amazon\'s Kindle Direct Publishing, Apple Books, or Kobo.'=>'用于从电子阅读器、平板电脑或手机读取的 ePub 文件;或者在亚马逊的Kindle Direct Publishing，Apple Books或Kobo等电子书市场上出版。','Create unlimited ePubs with any purchase.'=>'通过任何购买创建无限的电子酒吧。','Word Document'=>'Word文档','File editable in Microsoft Word, Google Docs, and LibreOffice (not Apple\'s Pages app, unfortunately). Useful for sharing persons and programs that require a ".doc" file. Word Documents typically require manual formatting in your chosen Word Processor.'=>'文件可在Microsoft Word，Google Docs，LibreOffice等中编辑。对于共享需要“.doc”文件的人员和程序很有用。Word 文档通常需要在您选择的文字处理器中手动设置格式。','Create unlimited Word Documents with a Pro Plan.'=>'使用专业计划创建无限的Word文档。','About Quick Print'=>'关于快速打印','This is the quick-and-easy option, best for making printouts for your own records. For something more professional and full-featured, use %1$sPro Print%2$s. It has free and paid options. %3$sSee full feature comparison.%2$s'=>'这是快速简便的选项，最适合为您自己的记录制作打印输出。如需更专业和功能齐全的内容，请使用 %1$sPro Print%2$s。它有免费和付费选项。%3$s查看完整功能比较。%2$s','About Pro Print'=>'关于专业打印','Pro Print is the best way to make professional-quality documents. You will be able to print them for free using your browser, or upgrade to use Print My Blog Pro\'s full features. %1$sSee full feature comparison.%2$s'=>'专业打印是制作专业品质文档的最佳方式。您将能够使用浏览器免费打印它们，或升级以使用“打印我的博客专业版”的全部功能。%1$s查看完整功能比较。%2$s','If you just want something quick, use %1$sQuick Print%2$s instead.'=>'如果您只是想要快速操作，请改用%1$s快速打印%2$s。','Project Designs are like WordPress Themes'=>'项目设计就像WordPress主题','Each has a different look and options that can be customized.'=>'每个都有不同的外观和可以自定义的选项。','The "Classic" design is the most similar Print My Blog’s Quick Print, so it’s a good default choice.'=>'“经典”设计与“打印我的博客”的快速打印最相似，因此它是一个不错的默认选择。','Click on the preview image for more details, and feel free to come back to this page later if you want to try a different design.'=>'单击预览图像以获取更多详细信息，如果您想尝试不同的设计，请稍后返回此页面。','Read the User Guide'=>'阅读用户指南','Each Design has Different Options and is Reusable'=>'每种设计都有不同的选项，并且可以重复使用','Below are your chosen design’s customization options.'=>'以下是您选择的设计的自定义选项。','If you don’t see an option you need, you may want to go back and choose a different design, or ask the design’s author for it.'=>'如果您没有看到所需的选项，您可能需要返回并选择其他设计，或向设计的作者询问。','Note: designs are reused between projects. So customizations to this design will be reused by other projects using this same design'=>'注意：设计在项目之间重复使用。因此，使用此设计的其他项目将重用此设计的自定义项','How to Edit Project Content'=>'如何编辑项目内容','Find the articles (posts, pages, other post types) from WordPress you want to add on the left, and add it to your project on the right by dragging'=>'在左侧从WordPress中找到要添加的文章（帖子，页面，其他帖子类型），然后通过拖动将其添加到右侧的项目中','Title Page and Table of Contents print materials are automatically added to each project, but you can remove or %1$scustomize them%2$s.'=>'标题页和目录打印材料会自动添加到每个项目中，但您可以删除或%1$s自定义它们%2$s。','Place articles in either front matter, body, or back matter, according to how you want your project organized. Each design can style them differently (eg front matter is often is numbered with roman numerals)'=>'根据您希望项目的组织方式将文章放在前体、正文或后体中。每种设计都可以以不同的方式设置它们的样式（例如，前部通常用罗马数字编号）','Nest content inside others to create parts'=>'将内容嵌套在其他人内部以创建零件','Read the User Guide on how to edit your project\'s content.'=>'阅读用户指南，了解如何编辑项目内容。','Everything Else About Your Project is Stored Here'=>'有关项目的其他所有内容都存储在此处','Different formats and designs may require other information about your project.'=>'不同的格式和设计可能需要有关项目的其他信息。','Some examples of metadata are: title page info, file info, or copyright data.'=>'元数据的一些示例包括：标题页信息、文件信息或版权数据。','So although your choice of design may affect what metadata is required, it is not shared with other projects.'=>'因此，尽管您选择的设计可能会影响所需的元数据，但它不会与其他项目共享。','Generate and View Your File'=>'生成和查看您的文件','Your project is ready to be generated! Clicking "Generate" will compile your content into a print-page.'=>'您的项目已准备好生成！单击“生成”会将您的内容编译到打印页面中。','Read the User Guide on %1$supdating%2$s, %3$sgenerating the pro file%2$s, and %4$sgetting help%2$s.'=>'阅读有关%1$s更新%2$s、%3$s生成专业文件%2$s和%4$s获取帮助%2$s的用户指南。','Posts just for Print My Blog'=>'帖子只为打印我的博客','Print My Blog "Print Materials" are like private posts. They aren’t visible to site visitors, but you can use them in your Pro Print Projects.'=>'打印我的博客 “打印材料”就像私人帖子。它们对网站访问者不可见，但您可以在专业打印项目中使用它们。','Title Page'=>'标题页','Table of Contents'=>'内容目录','Single Column'=>'单列','Fullpage Content'=>'整页内容','Centered Content'=>'中心内容','Full Column Content'=>'整页内容','Important'=>'重要的','Print'=>'打印','Print 🖨'=>'打印 🖨','PDF'=>'PDF','PDF 📄'=>'.PDF 📄','eBook'=>'电子书','eBook 📱'=>'电子书 📱','Invalid format "%s".'=>'格式“%s”无效。','Site Title'=>'网站标题','Tagline'=>'标语','Filters Used'=>'使用的过滤器','E.g. selected categories, taxonomies, and date range.'=>'例如，所选类别、分类法和日期范围。','Credit Print My Blog Plugin'=>'信用打印我的博客插件','Show some love and tell your readers about Print My Blog %1$s'=>'表达一些爱，并告诉您的读者有关“打印我的博客”%1$s','Extra dividing line at end of post'=>'帖子末尾的额外分界线','1'=>'1','2'=>'2','3'=>'3','The number of columns of text on each page. Not supported by some web browsers.'=>'每页上的文本列数。某些 Web 浏览器不支持。','Pro Print lets you specify header and text size and font'=>'专业打印允许您指定标题和文本大小以及字体','Tiny (1/2 size)'=>'小（1/2 尺寸）','Small (3/4 size)'=>'小（3/4 尺寸）','Normal (theme default)'=>'普通（默认主题）','Large (slightly larger than normal)'=>'大（比正常情况略大）','Image Size'=>'图片大小','Full (theme default)'=>'完整（默认主题）','Large (3/4 size)'=>'大（3/4 尺寸）','Medium (1/2 size)'=>'中号（1/2 尺寸）','Small (1/4 size)'=>'小（1/4 尺寸）','None (hide images)'=>'无（隐藏图像）','If you want to save paper, choose a smaller image size, or hide images altogether.'=>'如果要节省纸张，请选择较小的图像大小，或完全隐藏图像。','Include Hyperlinks'=>'包括超链接','Pro Print with Pro PDF Service supports changing hyperlinks to page references or footnotes'=>'使用专业 PDF 服务进行专业打印支持更改页面引用或脚注的超链接','Include'=>'包括','Replace with URL in Parenthesis'=>'替换为括号中的网址','Note: PDFs generated in Firefox and Safari automatically remove hyperlinks. If you want your PDF to include hyperlinks, please use another browser.'=>'注意：在 Firefox 和 Safari 中生成的 PDF 会自动删除超链接。如果您希望您的 PDF 包含超链接，请使用其他浏览器。','Post Rendering Wait-Time'=>'渲染后等待时间','ms'=>'毫秒','Milliseconds to wait between rendering posts. If posts are rendered too quickly on the page, sometimes images won’t load properly. '=>'在渲染帖子之间等待的毫秒数。如果帖子在页面上呈现得太快，有时图像将无法正确加载。','Include Inline Javascript'=>'包括内联 JavaScript','Sometimes posts contain inline javascript which can cause errors and stop the page from rendering.'=>'有时帖子包含内联javascript，这可能会导致错误并阻止页面呈现。','Include Unrendered Shortcodes'=>'包括未渲染的短代码','If you left shortcodes from deactivated deactivated plugins or themes in your posts, they are automatically removed from printouts. Check this to leave them.'=>'如果您在帖子中留下了已停用的插件或主题的短代码，它们会自动从打印输出中删除。检查此内容以离开它们。','article'=>'文章','part'=>'零件','volume'=>'音量','anthology'=>'文选','No generator class specified for format "%s"'=>'没有为格式“%s”指定生成器类','Setup'=>'设置','Choose %s Design'=>'选择%s设计','Customize %s Design'=>'定制%s设计','Edit Content'=>'编辑内容','Edit Metadata'=>'编辑元数据','Generate Print Page'=>'生成打印页面','The design with slug "%s" should exist but doesn\'t. Check the plugin that added that design is still active (and if it required a subscription, that the subscription is still up-to-date). For now, please choose a different design.'=>'带有 slug “%s”的设计应该存在，但没有。检查添加该设计仍处于活动状态的插件（如果需要订阅，则订阅仍然是最新的）。现在，请选择不同的设计。','Template file "%s" should exist but doesn\'t.'=>'模板文件“%s”应该存在，但不存在。','Default Template'=>'默认模板','No license ID available'=>'没有可用的许可证 ID','There is no site registered with Freemius'=>'没有在Freemius注册的网站','Your project is very big and you might have errors downloading the file. If so, try splitting your content into multiple projects and instead creating multiple smaller files.'=>'您的项目非常大，下载文件时可能会遇到错误。如果是这样，请尝试将内容拆分为多个项目，然后创建多个较小的文件。','Your project has lots of images and you might have errors downloading the file. If so, try spltting your content into multiple projects or reducing the image quality set on your design.'=>'您的项目包含大量图像，下载文件时可能会遇到错误。如果是这样，请尝试将内容拆分到多个项目中或降低设计上设置的图像质量。','Downloading the Paid PDF will use one of your %1$s remaining credits, and is non-refundable.'=>'下载付费 PDF 将使用您剩余%1$s配额之一，且不可退款。','Table of content - In Microsoft Word, please right-click and choose "Update field".'=>'目录 - 在Microsoft Word中，请右键单击并选择“更新字段”。','Projects'=>'项目','Projects for printing with Print My Blog'=>'使用“打印我的博客”进行打印的项目','Designs for printing with Print My Blog'=>'使用“打印我的博客”进行打印的设计','Post type general name' . "\4" . 'Print Materials'=>'印刷材料','Post type singular name' . "\4" . 'Print Material'=>'打印材料','Admin Menu text' . "\4" . 'Print Materials'=>'印刷材料','Add New on Toolbar' . "\4" . 'Print Material'=>'打印材料','Add New'=>'新增','Add New Print Material'=>'添加新的打印材料','New Print Material'=>'新的印刷材料','Edit Print Material'=>'编辑打印材料','View Print Material'=>'查看打印材料','All Print Materials'=>'所有打印材料','Search Print Materials'=>'搜索打印材料','Parent Print Materials:'=>'父打印材料：','No Print Materials found.'=>'未找到打印材料。','No Print Materials found in Trash.'=>'在“废纸篓”中找不到打印材料。','Overrides the “Featured Image” phrase for this post type. Added in 4.3' . "\4" . 'Print Material Cover Image'=>'打印材料封面图像','Overrides the “Set featured image” phrase for this post type. Added in 4.3' . "\4" . 'Set cover image'=>'设置封面图片','Overrides the “Remove featured image” phrase for this post type. Added in 4.3' . "\4" . 'Remove cover image'=>'删除封面图片','Overrides the “Use as featured image” phrase for this post type. Added in 4.3' . "\4" . 'Use as cover image'=>'用作封面图片','The post type archive label used in nav menus. Default “Post Archives”. Added in 4.4' . "\4" . 'Print Material archives'=>'打印材料档案','Overrides the “Insert into post”/”Insert into page” phrase (used when inserting media into a post). Added in 4.4' . "\4" . 'Insert into Print Material'=>'插入到打印材料中','Overrides the “Uploaded to this post”/”Uploaded to this page” phrase (used when viewing media attached to a post). Added in 4.4' . "\4" . 'Uploaded to this Print Material'=>'上传到此印刷材料','Screen reader text for the filter links heading on the post type listing screen. Default “Filter posts list”/”Filter pages list”. Added in 4.4' . "\4" . 'Filter Print Materials list'=>'过滤打印材料列表','Screen reader text for the pagination heading on the post type listing screen. Default “Posts list navigation”/”Pages list navigation”. Added in 4.4' . "\4" . 'Print Materials list navigation'=>'打印材料列表导航','Screen reader text for the items list heading on the post type listing screen. Default “Posts list”/”Pages list”. Added in 4.4' . "\4" . 'Print Materials list'=>'打印材料列表','The scheme ("%1$s") on the temporary file ("%2$s") indicates is located elsewhere, that’s not ok!'=>'临时文件（“%2$s”）上的方案（“%1$s”）表示位于其他地方，这不行！','NULL'=>'零','This is not a valid absolute URL. Eg, http://domain.com/monkey.jpg'=>'这不是有效的绝对 URL。例如，http://domain.com/monkey.jpg','Please check your input'=>'请检查您的输入','Form submitted successfully'=>'表单已成功提交','Unknown'=>'未知','%1$s : %2$s'=>'%1$s [%2$s]','In order to use Twine forms, you need to define TWINE_MAIN_FILE to